import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div>
      <h1>PRAKRUTHI MANJUNATHA</h1>
      <Link to={"/"}>Home</Link>
      <Link to={"/"}>About Me</Link>
      <Link to={"/"}>Projects</Link>
      <Link to={"/"}>Skills</Link>
    </div>
  );
};

export default Header;
